import './App.css';

function App() {
  return (
    <div className="App">
     <h1>CRUD App with MERN</h1>
<label>Food Name:</label>
     <input type='text'/>
     <input type='number'/>
     <button>Add to List</button>

    </div>
  );
}

export default App;
